import React from 'react';
const AboutmeIntro = () => (
    <>
    Hi, I’m Stacey, an incoming freshman at UIUC (class of 2025) majoring in computer engineering. 

    I enjoy coding and want to become a software engineer in the future. 

    Although I’m still exploring the different areas of software engineering,  I’m currently interested in developing front-end applications the most.
    </>
);

export default AboutmeIntro;
